public class PalindromeIndex {

    public int solve(String str) {
        StringBuilder sb=new StringBuilder(str);
        int len=str.length();
        for (int i = -1; i < len; i++) {
            if (isPalindrome(sb, i))
                return i;
        }
        return -1;
    }

    private boolean isPalindrome(StringBuilder str, int skeepIdx) {
        boolean res = true;
        int init=0;
        if (skeepIdx>0 && skeepIdx<str.length()/2-1 )
            init=skeepIdx;

        for (int i=init; i < str.length() / 2; i++) {
            int start=i;
            int end=str.length() - i - 1;
            if(start>=skeepIdx && skeepIdx>=0){
                start+=1;
            }
            else if(end<=skeepIdx)
                end-=1;
            if (str.charAt(start) != str.charAt(end)) {

                res = false;
                break;
            }
        }
        return res;
    }

    private boolean isPalindrome1(String str, int skeepIdx) {
        boolean res = true;
        int init=0;

        for (int i=init; i < str.length() / 2; i++) {
            int start=i;
            int end=str.length() - i - 1;
            if(start>=skeepIdx && skeepIdx>=0){
                start+=1;
            }
            else if(end<=skeepIdx)
                end-=1;
            if (str.charAt(start) != str.charAt(end)) {

                res = false;
                break;
            }
        }
        return res;
    }

    public static void main(String[] args) {
        PalindromeIndex pi = new PalindromeIndex();
        System.out.println(pi.solve("aaab"));
        System.out.println(pi.solve("baa"));
        System.out.println(pi.solve("aaa"));
        System.out.println(pi.solve("aaasaaaaa"));
        System.out.println(pi.solve(""));
        String sss="";
        System.out.println(pi.solve(sss));

    }
}//4781
